import React from "react";
import SignUpImg from "../images/sign-up-img.png";

function SignUpComponent() {
  return (
    <div className="sign-up-component">
      <main className="display-f">
        <div className="sign-up-container">
          <h3>Create an account</h3>
          <p>
            Join Free Today! Register to discover and cultivate your love for
            food!
          </p>

          <button  className="Sign-up-with-google">Sign Up With Google</button>
        </div>
        <div className="sign-up-graphic"></div>
      </main>
    </div>
  );
}

export default SignUpComponent;
